import React from 'react';
import TextField from '@material-ui/core/TextField';
import Dialog from '@material-ui/core/Dialog';
import DialogActions from '@material-ui/core/DialogActions';
import DialogContent from '@material-ui/core/DialogContent';
import DialogContentText from '@material-ui/core/DialogContentText';
import {DialogTitle, Button,Typography }from '@material-ui/core';
import { makeStyles, useTheme,Card, CardContent, CardMedia,IconButton, Grid } from '@material-ui/core';
import CloseIcon from '@material-ui/icons/Close';

const useStyles = makeStyles((theme) => ({
    tittle:{
        display: 'flex',
        textAlign:'center'
    }


  }));
function Popup(props) {
    const{ openPopup,setOpenPopup} = props;
    const{ closePopup,setClosePopup} = props;

    const classes = useStyles();
    const theme = useTheme();
    return (
        <div>
      <Dialog  aria-labelledby="customized-dialog-title" open={openPopup}>
        <DialogTitle id="customized-dialog-title"  onClick={()=>{setOpenPopup(false)}} className={classes.tittle}>
         Login
          <CloseIcon />
        </DialogTitle>
        <DialogContent dividers>
          <Typography gutterBottom>
            Cras mattis consectetur purus sit amet fermentum. Cras justo odio, dapibus ac facilisis
            in, egestas eget quam. Morbi leo risus, porta ac consectetur ac, vestibulum at eros.
          </Typography>
          <Typography gutterBottom>
            Praesent commodo cursus magna, vel scelerisque nisl consectetur et. Vivamus sagittis
            lacus vel augue laoreet rutrum faucibus dolor auctor.
          </Typography>
          <Typography gutterBottom>
            Aenean lacinia bibendum nulla sed consectetur. Praesent commodo cursus magna, vel
            scelerisque nisl consectetur et. Donec sed odio dui. Donec ullamcorper nulla non metus
            auctor fringilla.
          </Typography>
        </DialogContent>
        <DialogActions>
          <Button autoFocus onClick={()=>{setOpenPopup(false)}} color="primary">
            Save changes
          </Button>
        </DialogActions>
      </Dialog>
        {/* <Dialog open={openPopup} aria-labelledby="form-dialog-title">
        <DialogTitle id="form-dialog-title">Login</DialogTitle>
        <DialogContent>
        <Typography variant="h6" component="div" style={{ flexGrow: 1 }}>

                    </Typography>
                    <Button
                        color="secondary"
                        onClick={()=>{setOpenPopup(false)}}>
                        <CloseIcon />
                    </Button>
          <DialogContentText>
            To subscribe to this website, please enter your email address here. We will send updates
            occasionally.
          </DialogContentText>
          <TextField
            autoFocus
            margin="dense"
            id="name"
            label="Email Address"
            type="email"
            fullWidth
          />
        </DialogContent>
        <DialogActions> */}
          {/* <Button onClick={handleClose} color="primary">
            Cancel
          </Button> */}
          {/* <Button onClick={handleClose} color="primary">
            Subscribe
          </Button>  */}
        {/* </DialogActions>
      </Dialog> */}
        </div>
    );
}

export default Popup;
